    related to enforcement of the Animal Welfare and Horse Protection Acts. Form 7060
    - Official warning of an alleged violation of statue or regulation and notice to
    the subject that APHIS may seek civil or criminal penalties for alleged violation
    in the future if the subject again violates. Stipulation - a pre-litigation monetary
    settlement between APHIS and the subject.  The stipulation provides the subject
    with notice of alleged violation, affords the subject an opportunity for an administrative
    hearing, and offers the subject an opportunity to waive the hearing and pay a monetary
